import "./Work.css";
import "./App.css";
import HamburgerMenu from "./Hamburger";
import NavbarPink from "./NavbarPink.js";
import { Link, BrowserRouter as Router, Route, Switch } from "react-router-dom";
import artscene1 from "./images/artscene-1.png";
export default function About() {
  return (
    <div className="Work">
      <NavbarPink />
      <div className="Hamburger">
        <Link to="/menu">
          <HamburgerMenu />
        </Link>
      </div>
      <p>
        Art Scene is a responsive web app created with React that allows people
        to find art exhibitions based on several criteria: distance from them,
        genre, and cost. The app then displays the matching exhibitions on a
        Google map with links to get more info and purchase tickets.
      </p>
      <div className="Projects">
        <img src={artscene1} alt="art scene 1" width={"100%"} />
      </div>
    </div>
  );
}
